        "title": "How Does Gravity Warp the Flow of Time?",
        "description": "PBS Member Stations rely on viewers like you. To support your local station, go to: http://to.pbs.org/DonateSPACE\n‚Üì More info below ‚Üì\n\nSign Up on Patreon to get access to the Space Time Discord! \nhttps://www.patreon.com/pbsspacetime\n\nThere‚Äôs a deep connection between gravity and time - gravitational fields seem to slow the pace of time in what we call gravitational time dilation. And today we‚Äôll explore the origin of this effect. And ultimately, we‚Äôll use what we learn to understand how curvature in time - this gradient of time dilation - can be thought of as the true source of the force of gravity. \n\n#space\u200b #generalrelativity #einstein\n\nCheck out the Space Time Merch Store\nhttps://pbsspacetime.com\n\nSign up for the mailing list to get episode notifications and hear special announcements!\nhttps://mailchi.mp/1a6eb8f2717d/spacetime\n\nHosted by Matt O'Dowd\nWritten by Matt O'Dowd \nGraphics by Leonardo Scholzer, Yago Ballarini, Pedro Osinski, Adriano Leal & Stephanie Faria\nDirected by Andrew Kornhaber\nAssistant Producer: Setare Gholipour\nExecutive Producers: Eric Brown & Andrew Kornhaber\n\nEnd Credits Music by J.R.S. Schattenberg: https://www.youtube.com/channel/UCRl6-nb4iOnsij-vnpAjp0Q\n\nSpecial Thanks to Our Patreon Supporters\n\nBig Bang Supporters\nSandy Wu\nMatthew Miller\nClinton Robinson\nSean Maddox\nBrodie Rao\nScott Gray\nAhmad Jodeh\nRadu Negulescu\nAlexander Tamas\nMorgan Hough\nJuan Benet\nFabrice Eap\nMark Rosenthal\nDavid Nicklas\n\nQuasar Supporters\nHank S\nChristina Oegren\nMark Heising\nVinnie Falco\n\nHypernova Supporters\nWilliam Bryan\nLeo Emerson\nmuOn Marketing\nRussell Pope\nBen Delo\nL. Wayne Ausbrooks\nNicholas Newlin\nMark Matthew Bosko\nJason Finn\n–ê–Ω—Ç–æ–Ω –ö–æ—á–∫–æ–≤\nAlec S-L\nJulian Tyacke\nJohn R. Slavik\nMathew\nDanton Spivey\nDonal Botkin\nJohn Pollock\nEdmund Fokschaner\nJoseph Salomone\nchuck zegar\nJordan Young\nm0nk\nJohn Hofmann\nTimothy McCulloch\n\nGamma Ray Burst S